import React from "react";
import { Box, Input } from "@mantine/core";

const Layout3 = ({ inputValue, onInputChange }) => {
  return (
    <Box>
      <Input
        value={inputValue}
        onChange={(event) => onInputChange(event.target.value)}
        placeholder="Type something..."
      />
    </Box>
  );
};

export default Layout3;
